Rota escolar rural com MICRO tendo a capacidade de lotação de no mínimo 24 passageiros e 01 para o motorista nos turnos matutino, vespertino e noturno, seguindo as rotas:
- Carmos / Pedro Damas / Km 10 / Natureza e Sabater até os Colégios CESP / Machado / Milton Benner / Araci e Anselma, ida e volta – manhã;
- Carmos / Pedro Damas / Km 10 / Natureza e Sabater até os Colégios Machado / Milton Benner / Araci e Anselma, ida e volta – tarde;
- Carmos / Pedro Damas / KM 10 até o CESP, ida e volta – noite.
Percorrendo uma estimativa de 226,80 KM diários nos dias letivos. Contendo 01 (um) condutor habilitado com CNH “D” e 01 (um) monitor.

