Glifosato Herbicida – O Glifosato Herbicida deverá ser fornecido em galão não inferior a 20 litros, com as seguintes especificações: 
- Sal de Isopropilamina de N-(phosphonomethyl) glycine, com 480g/L (48,0 % m/v);
- Equivalente ácido de N-(phosphonomethyl) glycine, com 356 g/L (35,6 % m/v);
- Classe: Herbicida não seletivo, de ação sistêmica, do grupo químico glicina substituída;
- Tipo de formulação: Concentrado solúvel (SL).

LANCHE
- Biscoitos tipo Petit four, Monteiro Lopes, amanteigados, rosquinhas de castanha do Pará e outros;
- Bolo caseiro amanteigado (chocolate, castanha, queijo, laranja, maracujá, mármore ou formigueiro  sem recheio ou cobertura - a escolher);
- Sanduiches de queijo, queijo e presunto, em pão de forma ou brioche (quentes ou frios, a escolher);
- Prato salgado único, servido morno (quiche, torta, crepes de aspargos ou frango, rocambole);
- Refrigerantes (normais e diet);
- Sucos naturais (02 tipos)  Abacaxi, cupuaçu, goiaba, maracujá, acerola ou graviola).

ALMOÇO

- 02 (dois) pratos quentes  entre: carnes vermelhas; peixes; frango; frutos do mar; massa servido em réchaud em perfeito estado de apresentação;
- Acompanhamentos: arroz (branco, à piemontese ou similar), batata palha e farofa;
- 01 (uma) salada  entre: vegetais e ou legumes cozidos ou crus;
- 01 (uma) sobremesa  entre: cremes, pudins, saladas de frutas ou similar;
- 02 (dois) sucos naturais  entre: abacaxi, cupu.

Impressora de etiquetas rápido processador de 400 MHz;
Fácil carregamento de ribbon;
Desempenho e produtividade;
Linguagens: TSLP, ZPL2, EPL2, DPL2;
 Características Técnicas
Processador: 32 Bits – RISC;
Memória: 8MB Flash / 16MB SDRAM ;
Interface: USB 2.0;
Sensores: Sensor transmissivo, sensor reflexivo móvel, sensor de cabeça de impressão aberta e sensor de fim de ribbon;
Características da Impressão
Método de Impressão: Transferência Térmica ou Térmica Direta
Velocidade de Impressão: 6 Polegadas por segundo;
Largura Máxima de Impressão: 108mm;
Comprimento Máximo de Impressão: 2794mm  (110“);
Características de Mídia
Capacidade da Bobina: 5” (127mm) de diâmetro;
Tipo de Mídia: Com gap, contínua, perfurada, marca preta, formulário contínuo; 
Largura de Mídia Ajustável: 20 ~ 112 mm;
Espessura de Mídia: 0,06 a 0,19mm;
Diâmetro do Tubete: 1 e 1,5 Polegadas;
Características do Ribbon
Comprimento: 72, 110 e 300 metros;
Diâmetro Máximo: 40mm para ribbons de 72m e 110m e 67mm para ribbons de 300m;
Diâmetro Tubete: 0,5” (12,7mm - 72 a 100 metros) e 1” (25.4 mm - 300 metros)
Linguagem de Programação
TSPL-EZD (Compatível com EPL, ZPL, ZPL II, DPL)
Características de Operação
Temperatura de Operação: 5ºC ~ 40ºC – Umidade de Operação: 25 ~ 85% sem condensação;
Temperatura de Armazenagem: -40ºC ~ 60ºC – Umidade de Armazenagem: 10 ~ 90% sem condensação;
Características Físicas
Dimensões: 204 mm (L) x 164 mm (A) x 280 mm (C)
Modelo TSC - TE 200
compatível com os ribbon já utilizados na Secretaria de Saúde.
